der', '1', '', '1', '', '6', '68', '0', '0000-00-00 00:00:00');INSERT INTO `th_auth_rule` VALUES ('132', 'Porder/merchant_apply', '商家申请', 'Porder', '1', '', '1', '', '7', '132', '0', '0000-00-00 00:00:00');CREATE TABLE `th_banned` (
  `banned_id` int(11) NOT NULL AUTO_INCREMENT,
