) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8 COMMENT='禁言记录表';INSERT INTO `th_banned` VALUES ('1', '16', '1', '5', '1490694131');INSERT INTO `th_banned` VALUES ('9', '347', '25', '31', '1491556153');INSERT INTO `th_banned` VALUES ('10', '612', '67', '63', '1492089113');INSERT INTO `th_banned` VALUES ('13', '634', '63', '67', '1492149583');INSERT INTO `th_banned` VALUES ('14', '797', '66', '20', '1492658492');INSERT INTO `th_banned` VALUES ('17', '2014', '64', '20', '1495456552');CREATE TABLE `th_banner` (
  `b_id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `b_img` varchar(200) NOT NULL COMMENT '图片',
  `b_type` tinyint(3) NOT NULL DEFAULT '1' COMMENT '1无跳转；2:url   3:导师;4商品',
  `b_intime` datetime NOT NULL COMMENT '时间',
  `url` varchar(500) NOT NULL COMMENT '外链地址',
  `value` varchar(20) NOT NULL COMMENT '导师ID/商品id',
  `sort` int(11) NOT NULL COMMENT '排序',
  `content` text NOT NULL COMMENT '内容',
  `uptime` datetime NOT NULL,
  `title` varchar(30) NOT NULL COMMENT '标题',
  `is_del` tinyint(1) NOT NULL DEFAULT '1',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1下架；2上架',
  `type` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1是首页轮播；2是名师指点轮播；3论坛；4商城',
  `delete_time` datetime NOT NULL,
  PRIMARY KEY (`b_id`)
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8 COMMENT='banner';INSERT INTO `th_banner` VALUES ('8', 'http://dspx.tstmobile.com/uploads//image/20171028/6222ddc0d7c7ea9c02f71a102a10b28b.png', '2', '2017-05-11 10:28:21', '', '', '0', '<p><strong style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">央视网消息（新闻联播）：</strong><span style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">党的十九大闭幕仅一周，中共中央总书记、国家主席、中央军委主席习近平带领中共中央政治局常委李克强、栗战书、汪洋、王沪宁、赵乐际、韩正，于31日专程从北京前往上海和浙江嘉兴，瞻仰上海中共一大会址和浙江嘉兴南湖红船，回顾建党历史，重温入党誓词，宣示新一届党中央领导集体的坚定政治信念。习近平发表重要讲话强调，只有不忘初心、牢记使命、永远奋斗，才能让中国共产党永远年轻。只要全党全国各族人民团结一心、苦干实干，中华民族伟大复兴的巨轮就一定能够乘风破浪、胜利驶向光辉的彼岸。</span><br style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　31日上午，习近平等一下飞机，就来到位于上海市兴业路76号的中共一大会址。这座饱经沧桑的石库门建筑，1952年9月修复并对外开放，在繁华的现代化都市中庄严肃穆。96年前，1921年7月，中国共产党第一次全国代表大会在这里举行，会议的主要议程是成立中国共产党。</span><br style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　习近平等在兴业路下车后，步行来到中共一大会址纪念馆。习近平在上海工作期间曾3次到这里。在这里，习近平首先瞻仰了中共一大会议室原址。这个18平方米的房间按照当年会议场景复原布置。习近平久久凝视，叮嘱一定要把会址保护好、利用好。习近平动情地说，毛泽东同志称这里是中国共产党的“产房”，这个比喻很形象，我看这里也是我们中国共产党人的精神家园。</span><br style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　随后，习近平等瞻仰了中共一大代表群像浮雕，参观了《伟大开端——中国共产党创建历史陈列》。“前赴后继、救亡图存”“风云际会、相约建党”“群英汇聚、开天辟地”等专题展区，陈列着大量实物和图片，有的还有雕塑和沙盘，习近平一边听取介绍，一边询问细节。他对着浮雕一一列数中共一大13名代表的姓名，感叹英雄辈出，也感叹大浪淘沙。习近平指出，建党时的每件文物都十分珍贵、每个情景都耐人寻味，我们要经常回忆、深入思索，从中解读我们党的初心。</span><br style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　题为《追梦》的视频短片，浓缩了我们党波澜壮阔的奋斗历程，习近平等驻足观看。习近平表示，我们党的全部历史都是从中共一大开启的，我们走得再远都不能忘记来时的路。</span><br style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　纪念馆宣誓厅，悬挂着巨幅中国共产党党旗。面对党旗，习近平带领其他中共中央政治局常委同志一起重温入党誓词。在习近平领誓下，铿锵有力的宣誓声响彻大厅，让现场所有人都深受感染，仿佛回到了那个风雨如磐的年代。习近平强调，入党誓词字数不多，记住并不难，难的是终身坚守。每个党员要牢记入党誓词，经常加以对照，坚定不移，终生不渝。</span><br style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　当天下午，习近平等从上海乘火车来到浙江嘉兴市，继续追寻中共一大足迹。当时，正在上海召开的中共一大因遭到上海法租界巡捕袭扰，紧急转移到浙江嘉兴南湖一条小船上继续进行，在船上完成了大会全部议程。红船由此得名并名扬天下。</span><br style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　微风习习、清波荡漾的南湖，下午4时40分许迎来了习近平一行。习近平等走到湖边，瞻仰红船，详细了解利用红船开展爱国主义教育等情况。习近平指出，小小红船承载千钧，播下了中国革命的火种，开启了中国共产党的跨世纪航程。</span><br style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　离开南湖，习近平等前往南湖革命纪念馆参观。这座纪念馆2006年6月28日由时任浙江省委书记习近平亲自奠基，2011年纪念建党90周年前夕落成开放。</span><br style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　纪念馆圆形序厅里，精美的红船雕塑栩栩如生，硕大的镰刀锤头图案鲜艳夺目，二者交相辉映，寓意中国共产党领航中国号巨轮破浪前行。习近平等由此进入以“开天辟地”为主题的展厅，先后参观了“探索救亡图存道路”“中国共产党成立”等专题展览。这里展出的实物和图片，同上海中共一大会址的展览互为印证，详实记录了中国共产党诞生的历史全貌。习近平不时同其他常委同志交流。习近平表示，从纪念馆奠基那一刻起，我就一直想着落成后要来看一看，今天如愿以偿了，确实深受教育和鼓舞。</span><br style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　参观结束时，习近平发表了重要讲话。&nbsp;</span><br style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　临行时，习近平同纪念馆工作人员亲切握手，勉励大家从党的光辉历史中汲取奋进的力量，在为党和人民事业不断作出贡献的同时，书写好自己的人生篇章。</span><br style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　中共中央政治局委员丁薛祥、李强、陈希和中央有关部门负责同志，上海市、浙江省有关负责同志参加上述活动。</span></p>', '2017-11-01 08:19:36', '度珞社区文明公约', '1', '2', '1', '2017-09-28 17:22:38');INSERT INTO `th_banner` VALUES ('19', 'http://dspx.tstmobile.com/uploads/image/20171028/6222ddc0d7c7ea9c02f71a102a10b28b.png', '1', '2017-11-08 09:14:28', '', '', '0', '', '2017-11-08 09:32:29', 'hjk1', '1', '2', '1', '0000-00-00 00:00:00');CREATE TABLE `th_collection` (
  `collection_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL COMMENT '收藏者id',
  `type` tinyint(2) NOT NULL COMMENT 'l:资讯  2：视频',
  `about_id` int(11) NOT NULL COMMENT '被收藏的id',
  `intime` int(11) NOT NULL COMMENT '时间',
  PRIMARY KEY (`collection_id`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8 COMMENT='收藏表（视频、资讯）';INSERT INTO `th_collection` VALUES ('9', '55', '1', '4', '1485089473');INSERT INTO `th_collection` VALUES ('10', '57', '1', '5', '1485143842');INSERT INTO `th_collection` VALUES ('12', '69', '1', '4', '1485235260');INSERT INTO `th_collection` VALUES ('14', '69', '1', '5', '1485238078');INSERT INTO `th_collection` VALUES ('15', '63', '1', '7', '1485238967');INSERT INTO `th_collection` VALUES ('19', '55', '2', '1', '1486345839');INSERT INTO `th_collection` VALUES ('20', '55', '1', '6', '1486345972');CREATE TABLE `th_diamond_record` (
