  `level_id` int(11) NOT NULL AUTO_INCREMENT,
  `level` int(11) NOT NULL COMMENT '等级',
  `experience` int(11) NOT NULL COMMENT '经验',
  `intime` int(11) NOT NULL,
  `uptime` int(11) NOT NULL,
  PRIMARY KEY (`level_id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='等级表';INSERT INTO `th_level` VALUES ('1', '1', '0', '1489722234', '0');INSERT INTO `th_level` VALUES ('2', '2', '80', '1489722251', '0');INSERT INTO `th_level` VALUES ('3', '3', '240', '1489722329', '0');INSERT INTO `th_level` VALUES ('4', '4', '540', '1489722342', '0');CREATE TABLE `th_live` (
  `live_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL COMMENT '用户id',
  `play_img` varchar(300) NOT NULL COMMENT '直播封面',
  `title` varchar(50) NOT NULL COMMENT '直播标题',
  `lebel` varchar(100) NOT NULL DEFAULT '' COMMENT '标签（选择多个，以'',''隔开）',
  `live_tag` varchar(255) NOT NULL DEFAULT '' COMMENT '直播标签',
  `push_flow_address` varchar(500) NOT NULL COMMENT '推流地址',
  `play_address` varchar(500) NOT NULL COMMENT '播放地址',
  `play_address_m3u8` varchar(500) NOT NULL COMMENT '播放地址 m3u8',
  `start_time` int(11) NOT NULL COMMENT '直播开始时间',
  `end_time` int(11) NOT NULL COMMENT '直播结束时间',
  `stream_key` varchar(150) NOT NULL COMMENT '直播streamKey',
  `live_status` tinyint(3) NOT NULL COMMENT '1是在线； 2不在线',
  `live_time` int(11) NOT NULL COMMENT '按home键时间',
  `room_id` varchar(20) NOT NULL COMMENT '环信房间id',
  `nums` int(11) NOT NULL DEFAULT '0' COMMENT '直播人数',
  `watch_nums` int(11) NOT NULL DEFAULT '0' COMMENT '直播间观看人数',
  `light_up_count` int(11) NOT NULL DEFAULT '0' COMMENT '点亮',
  `intime` int(11) NOT NULL COMMENT '添加时间',
  `date` varchar(20) NOT NULL COMMENT '日期',
  `uptime` int(11) NOT NULL,
  `is_offline` tinyint(2) NOT NULL DEFAULT '1' COMMENT '是否是后台强制下线  1：否  2：是',
  `share` int(11) NOT NULL COMMENT '分享数',
  `zan` int(11) NOT NULL COMMENT '赞',
  `qrcode_path` varchar(500) NOT NULL COMMENT '二维码路径',
  `log` double NOT NULL COMMENT '经度',
  `lag` double NOT NULL COMMENT '纬度',
  `sheng` varchar(50) NOT NULL COMMENT '省',
  `shi` varchar(50) NOT NULL COMMENT '市',
  `qu` varchar(50) NOT NULL COMMENT '区',
  `livewindow_type` int(2) NOT NULL DEFAULT '1' COMMENT '直播窗口',
  `address` varchar(300) NOT NULL COMMENT '具体位置',
  `category_id` int(11) NOT NULL COMMENT '分类id',
  `qiniu_room_id` varchar(20) NOT NULL COMMENT '七牛直播间房间id',
  `qiniu_room_name` varchar(30) NOT NULL COMMENT '七牛直播间房间名称',
  `qiniu_token` varchar(300) NOT NULL COMMENT 'token',
  `is_normal_exit` tinyint(2) NOT NULL COMMENT '是否正常结束  1：正常  2：非正常',
  `tuijian_pc` tinyint(2) NOT NULL DEFAULT '1' COMMENT '是否推荐到pc端  1：否  2：是',
  `location` int(11) NOT NULL COMMENT '推荐位置',
  `pc_nums` int(11) NOT NULL COMMENT 'pc观看总人数',
  `pc_watch_nums` int(11) NOT NULL COMMENT 'pc当前观看人数',
  `live_money` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '观看金额设置',
  PRIMARY KEY (`live_id`),
  KEY `user_id` (`user_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=8380 DEFAULT CHARSET=utf8 COMMENT='直播表';INSERT INTO `th_live` VALUES ('5024', '8232', 'http://dspx.tstmobile.com/uploads/touxiang/20171015/94c330e2b3f219ec8bbdb04a037678b3.jpg', '许是', '', '', 'rtmp://fanlilive.tstmobile.com/vxiu1/php-sdk-test1508061096?e=1508064697&token=pR_CsEkFcTn1Kgf8ZNIh2zUB_w8bzaeLYEgjBItT:aSMfD0PshSsRkxoJKUUqu8nS49c=', 'rtmp://fanlilive.tstmobile.com/vxiu1/php-sdk-test1508061096', 'http://fanlilive.tstmobile.com/vxiu1/php-sdk-test1508061096.m3u8', '1508061097', '1508061242', 'php-sdk-test1508061096', '2', '0', '30055015186433', '5', '5', '0', '1508061097', '2017-10-15', '1508061242', '1', '0', '0', '', '121.495832', '31.166807', '上海市', '上海市', '浦东新区', '1', '上海市浦东新区杨新路281弄1-49号', '0', '123', '123', '123', '2', '1', '0', '0', '0', '0.00');INSERT INTO `th_live` VALUES ('5025', '8246', 'http://dspx.tstmobile.com/uploads/touxiang/20171015/ef7c7e88fe624e10ee59412e2d785466.jpg', 'hzjsjq', '', '', 'rtmp://fanlilive.tstmobile.com/vxiu1/php-sdk-test1508061707?e=1508065307&token=pR_CsEkFcTn1Kgf8ZNIh2zUB_w8bzaeLYEgjBItT:p6LIw1s4TuWCu5plHCKldBQ5xvQ=', 'rtmp://fanlilive.tstmobile.com/vxiu1/php-sdk-test1508061707', 'http://fanlilive.tstmobile.com/vxiu1/php-sdk-test1508061707.m3u8', '1508061707', '1508061961', 'php-sdk-test1508061707', '2', '0', '30055655866369', '6', '6', '0', '1508061707', '2017-10-15', '1508061961', '1', '0', '0', '', '121.495832', '31.166807', '上海市', '上海市', '浦东新区', '1', '上海市浦东新区杨新路281弄1-49号', '0', '123', '123', '123', '2', '1', '0', '0', '0', '0.00');INSERT INTO `th_live` VALUES ('5026', '8244', 'http://dspx.tstmobile.com/uploads/touxiang/20171015/a9722015d42390b9392a351b9ef513cf.jpg', 'fhj', '', '', 'rtmp://fanlilive.tstmobile.com/vxiu1/php-sdk-test1508061800?e=1508065400&token=pR_CsEkFcTn1Kgf8ZNIh2zUB_w8bzaeLYEgjBItT:IsTbp7xWMaOLjr8a0Z3NLWiT3zY=', 'rtmp://fanlilive.tstmobile.com/vxiu1/php-sdk-test1508061800', 'http://fanlilive.tstmobile.com/vxiu1/php-sdk-test1508061800.m3u8', '1508061800', '1508061961', 'ph