ms` VALUES ('3453', '17681442898', '963816', '1', '2017-11-13', '1510559465', '0');INSERT INTO `th_mobile_sms` VALUES ('3454', '18810541234', '561884', '1', '2017-11-13', '1510568184', '0');INSERT INTO `th_mobile_sms` VALUES ('3455', '17681442898', '616837', '1', '2017-11-14', '1510623714', '0');INSERT INTO `th_mobile_sms` VALUES ('3456', '17681442898', '354918', '2', '2017-11-14', '1510634950', '0');INSERT INTO `th_mobile_sms` VALUES ('3457', '17681442898', '932863', '1', '2017-11-14', '1510635629', '0');INSERT INTO `th_mobile_sms` VALUES ('3458', '17681442898', '180585', '2', '2017-11-14', '1510635717', '0');INSERT INTO `th_mobile_sms` VALUES ('3459', '17681442898', '953135', '2', '2017-11-14', '1510635784', '0');INSERT INTO `th_mobile_sms` VALUES ('3460', '17681442898', '614373', '2', '2017-11-14', '1510636055', '0');INSERT INTO `th_mobile_sms` VALUES ('3461', '17681442898', '024769', '1', '2017-11-14', '1510636207', '0');INSERT INTO `th_mobile_sms` VALUES ('3462', '17681442898', '913399', '1', '2017-11-14', '1510636273', '0');INSERT INTO `th_mobile_sms` VALUES ('3463', '13817442209', '308283', '1', '2017-11-14', '1510636332', '0');INSERT INTO `th_mobile_sms` VALUES ('3464', '17681442898', '855525', '1', '2017-11-14', '1510636368', '0');INSERT INTO `th_mobile_sms` VALUES ('3465', '17681442898', '964435', '1', '2017-11-14', '1510636468', '0');INSERT INTO `th_mobile_sms` VALUES ('3466', '17681442898', '246954', '2', '2017-11-14', '1510636677', '0');INSERT INTO `th_mobile_sms` VALUES ('3467', '13817442209', '921097', '1', '2017-11-14', '1510642639', '0');INSERT INTO `th_mobile_sms` VALUES ('3468', '13270675556', '290477', '1', '2017-11-16', '1510807475', '0');CREATE TABLE `th_notice` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(200) DEFAULT NULL COMMENT '标题',
  `state` tinyint(4) DEFAULT '1' COMMENT '1默认2开启',
  `type` tinyint(1) DEFAULT '1' COMMENT '1协议2公告3退改签规则;5退改签规则,6轮播文章',
  `object` varchar(32) DEFAULT '0' COMMENT '公告对象',
  `summary` varchar(150) DEFAULT NULL COMMENT '摘要',
  `content` text NOT NULL COMMENT '内容',
  `is_top` tinyint(4) DEFAULT '1' COMMENT '1默认2置顶',
  `intime` datetime DEFAULT NULL,
  `uptime` datetime DEFAULT NULL,
  `url` varchar(150) DEFAULT NULL COMMENT '外部链接',
  `is_del` tinyint(1) DEFAULT '1' COMMENT '1正常；2删除',
  `is_send` tinyint(1) DEFAULT '1' COMMENT '1未发送；2已发送',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8;INSERT INTO `th_notice` VALUES ('1', '商家直播协议', '1', '1', '0', '', '商家直播协议', '1', '2017-06-14 15:17:35', '', '', '1', '1');INSERT INTO `th_notice` VALUES ('2', '商家提现协议', '1', '1', '0', '', '商家提现协议', '1', '2017-06-14 15:17:40', '', '', '1', '1');INSERT INTO `th_notice` VALUES ('3', '商户入驻协议', '1', '1', '0', '', '<p>甲方：店铺名称&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;乙方：消费者</p><p>&nbsp; &nbsp; &nbsp;</p><p>&nbsp; &nbsp; &nbsp; 为了更好地为商家服务以及保障消费者权益，甲乙双方本着甲、乙双方本着平等合作、互惠互利的原则，在符合相关法律法规，不违反市场竞争的情况下，甲方须遵循乙方的运营管理规范，经友好协商，甲乙双方签署以下入驻协议。</p><p>&nbsp; &nbsp;</p><p>一、入驻商家的基本条件&nbsp;&nbsp;</p><p>1、甲方应在签订本协议时向乙方提供包括但不限于以下证明材料复印件：营业执照 、税务登记证、法人代表身份证复印件。</p><p>2、甲方必须有固定的教学场所、优良的师资及专业的培训课程，保证合作的顺利进行并提供良好的服务保障。&nbsp; &nbsp; &nbsp;</p><p>3、甲方要按照宝贝学堂的标准提供培训机构资料、课程介绍及师资情况等内容，在平台展示的信息须真实有效。&nbsp;&nbsp;</p><p><br/></p><p>二、入驻商家的基本类型&nbsp; &nbsp; &nbsp;&nbsp;</p><p>&nbsp; &nbsp; &nbsp; 作为进驻宝贝学堂的培训商家，以早教类、艺术兴趣类、课程辅导类等机构类型为主。</p><p>&nbsp; &nbsp; &nbsp; 甲方经申请通过即可开通后台管理账号，用于宝贝学堂的日常运维及推广。</p><p><br/></p>', '1', '2017-06-14 15:17:44', '2017-10-11 18:50:05', '', '1', '1');INSERT INTO `th_notice` VALUES ('4', '普通会员特权', '1', '1', '0', '', '普通会员特权', '1', '', '', '', '1', '1');INSERT INTO `th_notice` VALUES ('6', '积分的作用', '1', '1', '0', '', '&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;名师传艺使用帮助：&lt;/p&gt;&lt;p&gt;1、线上升级为您感兴趣名师的会员，观看她／他的直播，学到真本领；&lt;/p&gt;&lt;p&gt;2、线上名师私信指点，助您一臂之力；&lt;/p&gt;&lt;p&gt;3、商城内提供多样精美乐器，工欲善其事，必先利其器；&lt;/p&gt;&lt;p&gt;4、线上报名，线下名师开班活动，抢先学艺，乐此不疲。&lt;/p&gt;', '1', '', '2017-08-21 14:54:59', '', '1', '1');INSERT INTO `th_notice` VALUES ('7', '如何获得积分', '1', '1', '0', '', '&lt;p style=&quot;margin-top: 0px; text-align: center; font-size: 12px; text-indent: 2em; line-height: 2em;&quot;&gt;&lt;span style=&quot;line-height: normal; font-family: &quot; pingfang=&quot;&quot; font-size:=&quot;&quot;&gt;名师传艺用户隐私政策&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; text-align: center; font-size: 12px; text-indent: 2em; li