  `is_delete` tinyint(1) NOT NULL DEFAULT '0' COMMENT '1正常；2删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8;INSERT INTO `th_system_notice` VALUES ('1', '商家直播协议', '1', '0', '', '商家直播协议', '1', '2017-06-14 15:17:35', '', '', '1');INSERT INTO `th_system_notice` VALUES ('2', '商家提现协议', '1', '0', '', '商家提现协议', '1', '2017-06-14 15:17:40', '', '', '1');INSERT INTO `th_system_notice` VALUES ('3', '商户入驻协议', '1', '0', '', '<p>甲方：店铺名称&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;乙方：消费者</p><p>&nbsp; &nbsp; &nbsp;</p><p>&nbsp; &nbsp; &nbsp; 为了更好地为商家服务以及保障消费者权益，甲乙双方本着甲、乙双方本着平等合作、互惠互利的原则，在符合相关法律法规，不违反市场竞争的情况下，甲方须遵循乙方的运营管理规范，经友好协商，甲乙双方签署以下入驻协议。</p><p>&nbsp; &nbsp;</p><p>一、入驻商家的基本条件&nbsp;&nbsp;</p><p>1、甲方应在签订本协议时向乙方提供包括但不限于以下证明材料复印件：营业执照 、税务登记证、法人代表身份证复印件。</p><p>2、甲方必须有固定的教学场所、优良的师资及专业的培训课程，保证合作的顺利进行并提供良好的服务保障。&nbsp; &nbsp; &nbsp;</p><p>3、甲方要按照宝贝学堂的标准提供培训机构资料、课程介绍及师资情况等内容，在平台展示的信息须真实有效。&nbsp;&nbsp;</p><p><br/></p><p>二、入驻商家的基本类型&nbsp; &nbsp; &nbsp;&nbsp;</p><p>&nbsp; &nbsp; &nbsp; 作为进驻宝贝学堂的培训商家，以早教类、艺术兴趣类、课程辅导类等机构类型为主。</p><p>&nbsp; &nbsp; &nbsp; 甲方经申请通过即可开通后台管理账号，用于宝贝学堂的日常运维及推广。</p><p><br/></p>', '1', '2017-06-14 15:17:44', '2017-10-11 18:50:05', '', '1');INSERT INTO `th_system_notice` VALUES ('4', '普通会员特权', '1', '0', '', '普通会员特权', '1', '', '', '', '1');INSERT INTO `th_system_notice` VALUES ('6', '积分的作用', '1', '0', '', '&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;名师传艺使用帮助：&lt;/p&gt;&lt;p&gt;1、线上升级为您感兴趣名师的会员，观看她／他的直播，学到真本领；&lt;/p&gt;&lt;p&gt;2、线上名师私信指点，助您一臂之力；&lt;/p&gt;&lt;p&gt;3、商城内提供多样精美乐器，工欲善其事，必先利其器；&lt;/p&gt;&lt;p&gt;4、线上报名，线下名师开班活动，抢先学艺，乐此不疲。&lt;/p&gt;', '1', '', '2017-08-21 14:54:59', '', '1');INSERT INTO `th_system_notice` VALUES ('7', '如何获得积分', '1', '0', '', '&lt;p style=&quot;margin-top: 0px; text-align: center; font-size: 12px; text-indent: 2em; line-height: 2em;&quot;&gt;&lt;span style=&quot;line-height: normal; font-family: &quot; pingfang=&quot;&quot; font-size:=&quot;&quot;&gt;名师传艺用户隐私政策&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; text-align: center; font-size: 12px; text-indent: 2em; line-height: 2em;&quot;&gt;&lt;span style=&quot;line-height: normal; font-family: &quot; pingfang=&quot;&quot; font-size:=&quot;&quot;&gt;引言&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; text-align: left; font-size: 12px; text-indent: 2em; line-height: 2em;&quot;&gt;&lt;span style=&quot;line-height: normal; font-family: &quot; pingfang=&quot;&quot; font-size:=&quot;&quot;&gt;名师传艺重视您的隐私。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; text-align: left; font-size: 12px; text-indent: 2em; line-height: 2em;&quot;&gt;&lt;span style=&quot;line-height: normal; font-family: &quot; pingfang=&quot;&quot; font-size:=&quot;&quot;&gt;您在使用名师传艺服务时，名师传艺可能会收集和使用您的信息。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; text-align: left; font-size: 12px; text-indent: 2em; line-height: 2em;&quot;&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;span style=&quot;font-size: 16px; line-height: normal; font-family: &quot; pingfang=&quot;&quot;&gt;名师传艺希望通过本《隐私政策》向您说明在您使用名师传艺的服务时，名师传艺如何收集、使用、储存和分享这些信息，以及名师传艺为您提供的访问、更新、控制和保护这些信息的方式。本《隐私政策》与您所使用的名师传艺服务息息相关，名师传艺也希望您能够仔细阅读，并在需要时，按照本《隐私政策》的指引，作出您认为适当的选择。本《隐私政策》之中涉及的相关技术词汇，名师传艺尽量以简明扼要的表述向您解释，并提供了进一步说明的链接，以便您的理解。&lt;/span&gt;&lt;span style=&quot;font-size: 16px; line-height: normal; font-family: Tahoma;&quot;&gt; &lt;/span&gt;&lt;span style=&quot;font-size: 16px; line-height: normal; font-family: &quot; pingfang=&quot;&quot;&gt;您使用或继续使用名师传艺的服务，视为您同意名师传艺按照本《隐私政策》收集、使用、储存和分享您的信息。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; text-align: left; font-size: 12px; text-indent: 2em; line-height: 2em;&quot;&gt;&lt;span style=&quot;line-height: normal; font-family: &quot; pingfang=&quot;&quot; font-size:=&quot;&quot;&gt;如您对本《隐私政策》或与本《隐私政策》相关的事宜有任何问题，请通过客服与名师传艺联系。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; text-align: left; font-size: 12px; font-family: Tahoma; -webkit-text-stroke: rgb(0, 0, 0); margin-bottom: 10px; text-indent: 2em; line-height: 2em;&quot;&gt;&lt;span style=&quot;font-kerning: none; font-size: 16px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; text-align: left; font-size: 12px; text-indent: 2em; line-height: 2em;&quot;&gt;&lt;span style=&quot;line-height: normal; font-family: &quot; pingfang=&quot;&quot; font-size:=&quot;&quot;&gt;名师传艺收集的信息&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; text-align: left; font-size: 12px; text-indent: 2em; line-height: 2em;&quot;&gt;&lt;span style=&quot;line-height: normal; font-family: &quot; pingfang=&quot;&quot; font-size:=&quot;&quot;&gt;名师传艺提供服务时，可能会收集、储存和使用下列与您有关的信息。如果您不提供相关信息，可能无法注册成为名师传艺的用户、享受名师传艺提供的某些服务，或者即便名师传艺可以继续向您提供一些服务，也无法达到该服务拟达到的效果。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; text-align: left; font-size: 12px; font-family: Tahoma; -webkit-text-stroke: rgb(0, 0, 0); margin-bottom: 10px; text-indent: 2em; line-height: 2em;&quot;&gt;&lt;span style=&quot;font-kerning: none; font-size: 16px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; text-align: left; font-size: 12px; text-indent: 2em; line-height: 2em;&quot;&gt;&lt;span style=&quot;line-height: normal; font-family: &quot; pingfang=&quot;&quot; font-size:=&quot;&quot;&gt;您提供的信息&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; text-align: left; font-size: 12px; text-indent: 2em; line-height: 2em;&quot;&gt;&lt;span style=&quot;line-height: normal; font-family: &quot; pingfang=&quot;&quot; font-size:=&quot;&quot;&gt;您在注册名师传艺的账户或使用名师传艺的服务时，向名师传艺提供的相关个人信息，例如电话号码、电子邮件等；&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; text-align: left; font-size: 12px; text-indent: 2em; line-height: 2em;&quot;&gt;&lt;span style=&quot;line-height: normal; font-family: &quot; pingfang=&quot;&quot; font-size:=&quot;&quot;&gt;您通过名师传艺的服务向其他方提供的共享信息，以及您使用名师传艺的服务时所储存的信息。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; text-align: left; font-size: 12px; text-indent: 2em; line-height: 2em;&quot;&gt;&lt;span style=&quot;line-height: normal; font-family: &quot; pingfang=&quot;&q